        public static void VibrateGun()
        {
            void VibrateGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    PhotonNetwork.SetMasterClient(PhotonNetwork.LocalPlayer);
                    Photon.Realtime.Player owner6 = hit.collider.GetComponentInParent<PhotonView>().Owner;
                    PhotonView photonview = GorillaGameManager.instance.FindVRRigForPlayer(owner6);
                    photonview.RPC("SetJoinTaggedTime", owner6, null);
                }
            }

            if (VibrateEasyGun == null)
                VibrateEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            VibrateEasyGun.SendHit(VibrateGunHandler);
        }
        public static void SlowGun()
        {
            void SlowGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    PhotonNetwork.SetMasterClient(PhotonNetwork.LocalPlayer);
                    Photon.Realtime.Player owner9 = hit.collider.GetComponentInParent<PhotonView>().Owner;
                    PhotonView photonview = GorillaGameManager.instance.FindVRRigForPlayer(owner9);
                    photonview.RPC("SetTaggedTime", owner9, null);
                }
            }

            if (SlowEasyGun == null)
                SlowEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            SlowEasyGun.SendHit(SlowGunHandler);
        }
        public static void RigGun()
        {
            void RigGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (EasyInputs.GetTriggerButtonDown(EasyHand.RightHand))
                {
                    GorillaTagger.Instance.myVRRig.transform.position = hit.point;
                    GorillaTagger.Instance.myVRRig.enabled = false;
                }
                else
                {
                    GorillaTagger.Instance.myVRRig.enabled = true;
                }
            }
            if (RigEasyGun == null)
                RigEasyGun = new EasyGun(GunType.Normal, usecooldown: false) { };
            RigEasyGun.SendHit(RigGunHandler);
        }
        public static void FlickGun()
        {
            void FlickGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    GorillaLocomotion.Player.Instance.maxArmLength = 999f;
                    GorillaLocomotion.Player.Instance.rightHandTransform.transform.position = hit.point;
                }
            }

            if (FlickEasyGun == null)
                FlickEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            FlickEasyGun.SendHit(FlickGunHandler);
        }
        public static void TagGun()
        {
            void TagGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    Vector3 SP = GorillaLocomotion.Player.Instance.bodyCollider.transform.position = hit.point;
                    Quaternion SR = GorillaLocomotion.Player.Instance.bodyCollider.transform.rotation;
                    PhotonNetwork.Instantiate(" ", SP, SR, 0, null);
                }
            }

            if (TagEasyGun == null)
                TagEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            TagEasyGun.SendHit(TagGunHandler);
        }
        public static void CubeGun()
        {
            void CubeGunHandler(RaycastHit hit, VRRig hitRig)
            {
                {
                    Vector3 SP = GorillaLocomotion.Player.Instance.bodyCollider.transform.position = hit.point;
                    Quaternion SR = GorillaLocomotion.Player.Instance.bodyCollider.transform.rotation;
                    PhotonNetwork.Instantiate("bulletPrefab", SP, SR, 0, null);
                }
            }

            if (CubeEasyGun == null)
                CubeEasyGun = new EasyGun(GunType.Normal, usecooldown: false) { };

            CubeEasyGun.SendHit(CubeGunHandler);
        }
        public static void TargetGun()
        {
            void TargetGunHandler(RaycastHit hit, VRRig hitRig)
            {
                {
                    Vector3 SP = GorillaLocomotion.Player.Instance.bodyCollider.transform.position = hit.point;
                    Quaternion SR = GorillaLocomotion.Player.Instance.bodyCollider.transform.rotation;
                    PhotonNetwork.Instantiate("STICKABLE TARGET", SP, SR, 0, null);
                }
            }

            if (TargetEasyGun == null)
                TargetEasyGun = new EasyGun(GunType.Normal, usecooldown: false) { };

            TargetEasyGun.SendHit(TargetGunHandler);
        }

        public static void GiveCubeGun()
        {
            void GiveCubeGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    Vector3 vector = hitRig.transform.position + new Vector3(0f, 4f, 0f) + hitRig.transform.forward.normalized * 0.1f;
                    Quaternion quaternion = hitRig.transform.rotation * Quaternion.Euler(0f, 90f, 0f);
                    PhotonNetwork.Instantiate("bulletPrefab", vector, quaternion, 0, null);
                }
            }

            if (GiveCubeEasyGun == null)
                GiveCubeEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            GiveCubeEasyGun.SendHit(GiveCubeGunHandler);
        }
        public static void GiveTargetGun()
        {
            void GiveTargetGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    Vector3 vector = hitRig.transform.position + new Vector3(0f, 1.3f, 0f) + hitRig.transform.forward.normalized * 0.1f;
                    Quaternion quaternion = hitRig.transform.rotation * Quaternion.Euler(0f, 90f, 0f);
                    PhotonNetwork.Instantiate("STICKABLE TARGET", vector, quaternion, 0, null);
                }
            }

            if (GiveTargetEasyGun == null)
                GiveTargetEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            GiveTargetEasyGun.SendHit(GiveTargetGunHandler);
        }
