        public static void PlatGun()
        {
            void PlatGunHandler(RaycastHit hit, VRRig hitRig)
            {
                GameObject Froz = GameObject.CreatePrimitive(PrimitiveType.Cube);
                Froz.transform.localScale = new Vector3(0.025f, 0.3f, 0.4f);
                Froz.transform.localPosition = hit.point;
                Froz.GetComponent<Renderer>().material.color = Color.green;
                UnityEngine.Object.Destroy(Froz, 1);
            }

            if (PlatEasyGun == null)
                PlatEasyGun = new EasyGun(GunType.Normal, usecooldown: false) { };

            PlatEasyGun.SendHit(PlatGunHandler);
        }
        public static void TPGun()
        {
            void TPGunHandler(RaycastHit hit, VRRig hitRig)
            {
                GorillaLocomotion.Player.Instance.GetComponentInParent<Rigidbody>().velocity = Vector3.zero;
                GorillaLocomotion.Player.Instance.transform.position = hit.point;
            }

            if (tpEasyGun == null)
                tpEasyGun = new EasyGun(GunType.Normal, usecooldown: true) { };

            tpEasyGun.SendHit(TPGunHandler);
        }
        public static void RideGun()
        {
            void RideGunHandler(RaycastHit hit, VRRig hitRig)
            {
                if (hitRig != null)
                {
                    GorillaLocomotion.Player.Instance.GetComponent<Rigidbody>().isKinematic = true;
                    GorillaLocomotion.Player.Instance.transform.position = hit.point;
                    //GorillaLocomotion.Player.Instance.GetComponent<Rigidbody>().velocity = new Vector3(0f, 0f, 0f);
                    GorillaLocomotion.Player.Instance.GetComponent<Rigidbody>().isKinematic = false;
                }

            }

            if (RideEasyGun == null)
                RideEasyGun = new EasyGun(GunType.Lock, usecooldown: false) { };

            RideEasyGun.SendHit(RideGunHandler);
        }
    }
